Okay, let's analyze the existing models and identify potential avenues for new models. The existing models primarily focus on fairness and loss aversion based on tokens earned and split amounts/percentages. They explore different ways of defining "fairness" – based on token ratios or a direct comparison of splits.

A key aspect that hasn't been explicitly addressed is the *trial type*. The `trial_type` variable indicates whether the contributions were equal, the opponent contributed more, or the participant contributed more. This contextual information could significantly influence the participant's perception of fairness and the utility they derive from accepting an offer. We will create a utility function based on an inequity aversion model, specifically looking at advantageous inequity.

Here's the plan:

1.  **Incorporate `trial_type`:** Directly use `trial_type` to modulate the utility. Since `trial_type` already is on an ordinal scale, where 1 = equal, 2 = opponent more, 3 = participant more, we can directly incorporate it into the model.
2.  **Advantageous Inequity Aversion:** Focus on how much people like advantageous inequity to ensure it will pass parameter recovery.
3.  **Minimal Parameters:** Stick to a maximum of two learnable parameters, focusing on sensitivity.

<MODEL>
U_accept = alpha * split_self + beta * (trial_type - 1)
</MODEL>

