      },
      "learnable": false,
      "source": "data"
    },
    "beta": {
      "description": "Impact of trial type on utility. Scales the effect of trial_type-1 on the acceptance utility. Represents the baseline increased propensity to accept an offer when the participant earned more tokens.",
      "range": {
