This model calculates the utility of accepting an offer as a linear combination of the proposed split for the participant (split_self), modulated by a sensitivity parameter (alpha), and the trial type (trial_type), modulated by the trial_type parameter (beta), with 1 subtracted to make the neutral equal contributions the baseline.
</SUMMARY>

